const dark = {
  title: 'dark',

  colors: {
    primary: '#7458d8',
    secondary: 'black',

    background_primary: '#1c1d1f',
    surface: '#2d2c2f',

    text_primary: '#fff',
    text_secondary: '#919097',

    border: '#1f1e21',
  },
};

export default dark;
